Trimming the log removes all entries up to a certain index. Since the entries are deleted from the log, a trim operation can only be done if ALL nodes in the cluster have decided up to that index. Example: use omnipaxos_core::sequence_paxos::CompactionErr; // we will try trimming the first 100 entries of the log.
let trim_idx = Some(100); // using `None` will use the highest trimmable index
