Both the SequencePaxosHandle, and BLEHandle consist of two tokio mpsc channels each, one for incoming and one for outgoing messages. The user's task is to read messages from the outgoing channel and send them out over the network, and push any received message from the network layer into the incoming channel. As an example, we will use tokio to spawn a separate thread for each of these tasks: let mut sp_in: mpsc::Sender<Message<KeyValue, KVSnapshot>> = seq_paxos_handle.incoming; let mut sp_out: mpsc::Receiver<Message<KeyValue, KVSnapshot>> = seq_paxos_handle.outgoing; let mut ble_in: mpsc::Sender<BLEMessage> = ble_handle.incoming;
let mut ble_out: mpsc::Receiver<BLEMessage> = ble_handle.outgoing; tokio::spawn(async move { // spawn thread to wait for any outgoing messages produced by SequencePaxos while let Some(message) = sp_out.recv().await { let receiver = message.to; // send Sequence Paxos message over network to the receiver }
}); tokio::spawn(async move { // spawn thread to wait for any outgoing messages produced by BallotLeaderElection while let Some(message) = ble_out.recv().await { let receiver = message.to; // send BLE message over network to the receiver }
}); tokio::spawn(async move { // spawn thread to wait for any incoming Sequence Paxos messages from the network layer loop { // pass message to SequencePaxos let sp_msg = todo!(); // received message from network layer; sp_in.send(sp_msg).await.expect("Failed to pass message to SequencePaxos"); }
}); tokio::spawn(async move { // spawn thread to wait for any incoming BLE messages from the network layer loop { // pass message to BLE let ble_msg = todo!(); // received message from network layer; ble_in.send(ble_msg).await.expect("Failed to pass message to BallotLeaderElection"); }
}); We leave the logic for receiving messages over the network as todo!(), since this depends on your, the user's, network implementation.

